_service.sdl:
extend schema @link(url: "https://specs.apollo.dev/federation/v2.0", import: ["@key" ,"FieldSet"], as: "") 

directive @key(fields: FieldSet!, resolvable: Boolean = true) repeatable on OBJECT|INTERFACE

directive @link(url: String!, as: String, for: link__Purpose, import: [link__Import]) repeatable on SCHEMA

type Query {
  greet: String!
  _service: _Service!
  _entities(representations: [_Any!]!): [_Entity]!
}

type Moon @key(fields: "name", resolvable: false) {
  name: String!
}

type Star @key(fields: "name") {
  name: String!
  constellation: String!
  designation: String!
}

type Satellite @key(fields: "name") {
  name: String!
  MissionDuration: Int!
}

type Planet @key(fields: "name") @key(fields: "id") {
  id: Int!
  name: String!
  mass: Decimal!
  numberOfMoons: Int!
  moon: Moon
}

"The `Decimal` type corresponds to a subset of IEEE 754-2008 128-bit decimal (radix 10) floating point numbers"
scalar Decimal

scalar _Any

scalar FieldSet

scalar link__Import

enum link__Purpose {
  "`EXECUTION` features provide metadata necessary for operation execution."
  EXECUTION
  "`SECURITY` features provide metadata necessary to securely resolve fields."
  SECURITY
}

type _Service {
  sdl: String!
}

union _Entity = Moon|Star|Satellite|Planet
